import { useState } from "react"
import Product_card from "../components/product-card";

const Search = () => {
  const [search, setSearch] = useState('');
  const [sort, setSort] = useState('');
  const [maxPrice, setMaxPrice] = useState(100000);
  const [category, setCategoty] = useState('');
  const [page, setPage] = useState(1);

  const maxPage = 4;
  const isFirstPage = !(page>1);
  const isLastPage = !(page<maxPage);

  const addToCartHandler = () => {};


  return (
    <div className="product-search">
      <aside>
        <h2>Filters</h2>
        <div>
          <h4>Sort</h4>
          <select name="sort" value={sort} onChange={(e) => setSort(e.target.value)}>
            <option value="">None</option>
            <option value="asc">Price (Low to high)</option>
            <option value="desc">Price (High to low)</option>
          </select>
        </div>
        <div>
          <h4>Max Price: {maxPrice || ""}</h4>
          <input type="range" min={100} max={100000} name="maxprice" value={maxPrice} onChange={(e) => setMaxPrice(Number(e.target.value))} />
        </div>
        <div>
          <h4>Category: {category || ""}</h4>
          <select name="category" value={category} onChange={(e) => setSort(e.target.value)}>
            <option value="">All</option>
            <option value="electronic">Electronic</option>
            <option value="non_electronic">Non-Electronic</option>
          </select>
        </div>
      </aside>
      <main>
        <h1>Products</h1>
        <input type="text" name="search" value={search} onChange={(e)=>setSearch(e.target.value)} placeholder="Search here..." />
        <div className="search-product-list">
          <Product_card product_id="123"
          photo="data:image/jpeg;base64,"
          name="MacBook Air" price={120000} stock={12} handler={addToCartHandler} />
          <Product_card product_id="123"
          photo="data:image/jpeg;base64,"
          name="MacBook Air" price={120000} stock={12} handler={addToCartHandler} />
          <Product_card product_id="123"
          photo="data:image/jpeg;base64,"
          name="MacBook Air" price={120000} stock={12} handler={addToCartHandler} />
          <Product_card product_id="123"
          photo="data:image/jpeg;base64,"
          name="MacBook Air" price={120000} stock={12} handler={addToCartHandler} />
          <Product_card product_id="123"
          photo="data:image/jpeg;base64,"
          name="MacBook Air" price={120000} stock={12} handler={addToCartHandler} />
          <Product_card product_id="123"
          photo="data:image/jpeg;base64,"
          name="MacBook Air" price={120000} stock={12} handler={addToCartHandler} />
        </div>
        { maxPage > 1 &&
        <article>
          <button onClick={()=>setPage(page-1)} disabled={isFirstPage}>Prev</button>
          <span>{page} of {maxPage}</span>
          <button onClick={() => setPage(page+1)} disabled={isLastPage}>Next</button>
        </article>
        }
      </main>
    </div>
  )
}

export default Search